import React from 'react';
import map from './mapOfLocations.png';
import './App.css';

const useStyles = makeStyles(theme => ({
  formControl: {
    margin: theme.spacing(1),
    minWidth: 120,
    maxWidth: 300,
  },
  chips: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  chip: {
    margin: 2,
  },
  noLabel: {
    marginTop: theme.spacing(3),
  },
}));

function App() {
  return (
    <div className="App">
      <header className="App-header">2
        <img src={map} className="App-mapOfLocations" alt="mapOfLocations"/>
        <p>
          Select the companies you plan to visit!
        </p>
      </header>

    </div>
  );
}

export default App;
